            activeClass="active"
            to="homeH1"
            spy={false}
            smooth={true}
            offset={-500}
            duration={1000}
        >EdMiles.tech
    </Link>
  <Navbar.Toggle aria-controls="basic-navbar-nav" />
  <Navbar.Collapse id="basic-navbar-nav">
    <Nav className="mr-auto">
        <span className='nav-links' id='home-link'>
            <Link
