            to="projects-div"
            spy={false}
            smooth={true}
            offset={-40}
            duration={1000}
        >Projects
        </Link>
        </span>
        <span className='nav-links' id='email-me-link'>
            <a href='mailto:edmilestech@gmail.com'>Email</a>
        </span>

        <span id='media-links'>
            <a href='https://www.linkedin.com/in/edward-miles-407349143'
