                    rel="noreferrer">
                    <i class="fab fa-github"></i>
                </a>
            </span>
        </span>
        {/* <span>
            <i class="fab fa-twitter"></i>
        </span> */}
    </Nav>
  </Navbar.Collapse>
</Navbar>


